// VerticalNavbar.js
import React from 'react';

function Navbar() {
  return (
    <div className="bg-navblue w-16 flex flex-col rounded-lg items-center justify-center rounded-r-none">
        <button className="text-white py-3 px-4 mb-6 rounded-lg">
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="white" className="w-6 h-6">
  <path d="M11.47 3.841a.75.75 0 0 1 1.06 0l8.69 8.69a.75.75 0 1 0 1.06-1.061l-8.689-8.69a2.25 2.25 0 0 0-3.182 0l-8.69 8.69a.75.75 0 1 0 1.061 1.06l8.69-8.689Z" />
  <path d="m12 5.432 8.159 8.159c.03.03.06.058.091.086v6.198c0 1.035-.84 1.875-1.875 1.875H15a.75.75 0 0 1-.75-.75v-4.5a.75.75 0 0 0-.75-.75h-3a.75.75 0 0 0-.75.75V21a.75.75 0 0 1-.75.75H5.625a1.875 1.875 0 0 1-1.875-1.875v-6.198a2.29 2.29 0 0 0 .091-.086L12 5.432Z" />
</svg>
</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg"> 2</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg"> 3</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg"> 4</button>
        <button className="text-white py-3 px-4 mb-6 rounded-lg"> 5</button>
      </div>
  );
}

export default Navbar;
